/**
 * @module RaftParser
 */ /** */

import GCodeParser from "./gcode";
import RaftEngine from "../engines/base";

export default class GParser extends GCodeParser {

    constructor (engine: RaftEngine) {
        super(engine);
    }

    public clone(): GParser {
        return new GParser(this.engine.clone());
    }

    toString(): string {
        return "GParser";
    }

}
